import React from 'react';

function BarraNav(){
    return(
        <div>
           <nav>
        <ul>
            <li><a href="index.html">Home</a></li>
            <li><a href="registro.html">Registro</a></li>
            <li><a href="login.html">Login</a></li>
        </ul>
    </nav>
        </div>
    );
}
export default BarraNav;
